    "# PROBLEM 4:\n",
    "# Download csv data from the web and analyze using the methods above.\n",
    "# fb1 <- read.csv(\"http://realchart.finance.yahoo.com/table.csv?s=FB&d=10&e=5&f=2014&g=d&a=11&b=12&c=2013&ignore=.csv\") #Link is not available\n",
    "\n",
    "fb1 <- read.csv(\"data/FB.csv\")     # Read Facebook data from file FB.csv\n",
    "appl1 <- read.csv(\"data/APPL.csv\")   # Read Apple data from file APPL.csv\n",
    "par(bg=\"cornsilk\")\n",
    "plot(appl1$Adj.Close, col=\"blue\", type=\"o\", ylim=c(150,200), xlab=\"Days\", ylab=\"Price\" )\n",
    "lines(fb1$Adj.Close, type=\"o\", pch=22, lty=2, col=\"red\")\n",
    "legend(\"topright\", inset=.05, c(\"Apple\",\"Facebook\"), fill=c(\"blue\",\"red\"), horiz=TRUE)\n",
    "hist(appl1$Adj.Close, col=rainbow(8))"
   ]
  },
