   "source": [
    "# PROBLEM 7:\n",
    "# We will conclude the “base” graphics capabilities of R package with a very old\n",
    "# but popular data set available in R: mtcars (motor trends car package). Attach and explore\n",
    "# mtcars. Draw scatter plots of the dependent variables (i) 5 variables (ii) 4 variables\n",
    "\n",
    "library(lattice)\n",
    "splom(mtcars[c(1,3,4,5,6)], main=\"MTCARS Data\")\n",
    "splom(mtcars[c(1,3,4,6)], main=\"MTCARS Data\")\n",
    "splom(mtcars[c(1,3,4,6)], col=rainbow(7),main=\"MTCARS Data\")\n",
    "splom(rock[c(1,2,3,4)], main=\"ROCK Data\")"
   ]
